namespace SpriteKind {
    export const collecteble = SpriteKind.create()
}
sprites.onOverlap(SpriteKind.Enemy, SpriteKind.collecteble, function (sprite, otherSprite) {
    positioning(169, collect)
})
controller.down.onEvent(ControllerButtonEvent.Pressed, function () {
    player1.y += 35
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.collecteble, function (sprites2, otherSprite) {
    info.changeScoreBy(1)
    music.baDing.play()
    positioning(160, collect)
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    player1.setPosition(40, 40)
    info.changeLifeBy(-1)
    music.pewPew.play()
    scene.cameraShake(4, 500)
    info.changeScoreBy(-3)
    if (info.score() < 0) {
        info.setScore(0)
    }
})
function positioning (nun: number, mySprite: Sprite) {
    position = Math.randomRange(0, 3)
    if (position == 0) {
        mySprite.setPosition(nun, 15)
    }
    if (position == 1) {
        mySprite.setPosition(nun, 44)
    }
    if (position == 2) {
        mySprite.setPosition(nun, 78)
    }
    if (position == 3) {
        mySprite.setPosition(nun, 111)
    }
}
controller.up.onEvent(ControllerButtonEvent.Pressed, function () {
    player1.y += -35
})
let position = 0
let collect: Sprite = null
let player1: Sprite = null
